CREATE TABLE `company` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `uuid` varchar(36) NOT NULL,
  `legal_name` text NOT NULL,
  `status` tinyint NOT NULL DEFAULT '1',
  `start_at` timestamp NULL DEFAULT NULL,
  `end_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `logo` text,
  `prospect_id` int unsigned DEFAULT NULL,
  `sales_id` int DEFAULT NULL,
  `client_id` int unsigned DEFAULT NULL,
  `is_active` tinyint NOT NULL DEFAULT '1',
  `country` char(2) NOT NULL DEFAULT 'FR',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uuid_UNIQUE` (`uuid`),
  KEY `fk_company_prospect1_idx` (`prospect_id`),
  KEY `fk_company_client1_idx` (`client_id`),
  KEY `fk_company_country1_idx` (`country`),
  CONSTRAINT `fk_company_client1` FOREIGN KEY (`client_id`) REFERENCES `client` (`id`),
  CONSTRAINT `fk_company_country1` FOREIGN KEY (`country`) REFERENCES `country` (`iso_code_2`),
  CONSTRAINT `fk_company_prospect1` FOREIGN KEY (`prospect_id`) REFERENCES `prospect` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=194 DEFAULT CHARSET=utf8mb3;
