תם גם גניבות הרכב. כאשר יותר מכוניות חוזרות לכסות קילומטראז\' גבוה מאשר בשנה החולפת ונזקקות ליותר חלפים מכאניים, עושות יותר תאונות שמעלות את הדרישה לחלפים, עם שובם של לא מעט עובדים למקומות העבודה והשארת המכוניות למשך שעות כ\\\"טרף קל\\\" לגנבים - הם לא מאחרים להגיב לכך\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {}}',0,0,0,0,0,0,'2021-12-30 11:19:03','2021-12-30 13:17:11',NULL,NULL,NULL,NULL,'2021-12-30 11:19:03','live'),(248,254,'7c08c2f0-6962-11ec-9947-9c7bef452e53','מס הכנסה','מדינת ישראל הוציאה תיקון חוק היסטורי ומחלקת הטבות מפליגות בתחום המיסוי (40%) שמגיעות עד עשרות אלפי שקלים בשנה, נזילות מלאה בכספי הקרן, הורשה של קופת הגמל, השקעות גמישות והטבות רבות נוספות. כדאי מאד לב','{\"blocks\": [{\"key\": \"6j192\", \"data\": {}, \"text\": \"מדינת ישראל הוציאה תיקון חוק היסטורי ומחלקת הטבות מפליגות בתחום המיסוי (40%) שמגיעות עד עשרות אלפי שקלים בשנה, נזילות מלאה בכספי הקרן, הורשה של קופת הגמל, השקעות גמישות והטבות רבות נוספות. כדאי מאד לבדוק זכאותכם וזה לוקח רק דקה וחצי.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 65, \"offset\": 44}]}, {\"key\": \"2ivq0\", \"data\": {}, \"text\": \"אם אתם בני 55+ וצברתם מעל 300 אלף ש\\\"ח נזילים או שאתם נהנים מקצבה חודשית של 4,500 ש\\\"ח ומעלה – אתם כנראה זכאים להטבת מס מהמדינה!\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"fhnk0\", \"data\": {}, \"text\": \"כדי לגלות בתוך דקה וחצי את זכאותכם וגובה ההטבה שאתם זכאים לקבל, ענו על השאלה הבאה כד\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {}}',0,0,0,0,0,0,'2021-12-30 11:20:25','2021-12-30 13:19:11',NULL,NULL,NULL,NULL,'2021-12-30 11:20:25','live'),(249,254,'caed2675-6962-11ec-9947-9c7bef452e53','learn css','We recommend reading this tutorial, in the sequence listed in the menu.\n\nIf you have a large screen, the menu will always be p