 arrested after Myanmar security forces in a car rammed into an anti-coup protest on Sunday morning in Yangon, local news portal Myanmar Now reported.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"3jjtv\", \"data\": {}, \"text\": \"Witnesses on the scene told Reuters dozens had been injured. Photos and videos on social media show a vehicle that crashed through the protesters and bodies lying on the road.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"fshh7\", \"data\": {}, \"text\": \"Another protest was held in Yangon in the afternoon despite the morning violence.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"jccn\", \"data\": {}, \"text\": \"\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"c8f7c\", \"data\": {}, \"text\": \"Five people were killed and at least 15 arrested after Myanmar security forces in a car rammed into an anti-coup protest on Sunday morning in Yangon, local news portal Myanmar Now reported.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 48, \"offset\": 0}]}, {\"key\": \"297uc\", \"data\": {}, \"text\": \"Witnesses on the scene told Reuters dozens had been injured. Photos and videos on social media show a vehicle that crashed through the protesters and bodies lying on the road.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"dth72\", \"data\": {}, \"text\": \"Another protest was held in Yangon in the afternoon despite the morning violence.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {}}',0,0,0,0,0,0,'2021-12-30 12:47:28','2021-12-30 13:20:07',NULL,NULL,NULL,NULL,'2021-12-30 12:48:10','live'),(253,259,'1c5944ab-696f-11ec-9947-9c7bef452e5