recognition\", \"href\": \"https://en.wikipedia.org/wiki/Rapunzel_%28Tangled%29#Accolades_and_recognition\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"33\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Rapunzel_%28Tangled%29#References\", \"href\": \"https://en.wikipedia.org/wiki/Rapunzel_%28Tangled%29#References\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"34\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Rapunzel_%28Tangled%29#External_links\", \"href\": \"https://en.wikipedia.org/wiki/Rapunzel_%28Tangled%29#External_links\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}}}',0,0,0,0,0,0,'2021-12-30 13:39:32','2021-12-30 13:41:16',NULL,NULL,NULL,NULL,'2021-12-30 13:39:32','live'),(261,254,'2021c90b-6976-11ec-9947-9c7bef452e53','Rapunzel','the movie',NULL,0,0,0,0,0,0,'2021-12-30 13:41:00','2021-12-30 13:44:21','trailer','https://www.youtube.com/watch?v=vTGaBaK_ElY','','','2021-12-30 13:41:00','dead'),(269,254,'2ce4a518-6bca-11ec-90e2-9c7bef452e53','Cinderella','\"Cinderella\",[2] or \"The Little Glass Slipper\", is a folk tale with thousands of variants throughout the world.[3][4] The protagonist is a young woman living in forsaken circumstances that are suddenl','{\"blocks\": [{\"key\": \"44c5n\", \"data\": {}, \"text\": \"\\\"Cinderella\\\",[2] or \\\"The Little Glass Slipper\\\", is a folk tale with thousands of variants throughout the world.[3][4] The protagonist is a young woman living in forsaken circumstances that are suddenly changed to remarkable fortune, with her ascension to the throne via marriage. The story of Rhodopis, recounted by the Greek geographer Strabo sometime between around 7 BC and AD 23, about a Greek slave girl who marries the king of Egypt, is usually considered to be the earliest known variant of the Cinderella story.[3][4][5]\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 0, \"length\": 3, \"offset\": 13}, {\"key\": 1, \"length\": 9, \"offset\": 53}, {\"key\": 2, \"length\": 3, \"offset\": 111}, {\"key\": 3, \"length\": 3, \"offset\": 114}, {\"key\": 4, \"length\": 8, \"offset\": 293}, {\"key\": 5, \"length\": 6, \"offset\": 337}, {\"key\": 6, \"length\": 3, \"offset\": 519}, {\"key\": 7, \"length\": 3, \"offset\": 522}, {\"key\": 8, \"length\": 3, \"offset\": 525}], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 10, \"offset\": 1}, {\"style\": \"BOLD\", \"length\": 24, \"offset\": 21}]}, {\"key\": \"d998q\", \"data\": {}, \"text\": \"The first literary European version of the story was published in Italy by Giambattista Basile in his Pentamerone in 1634; the version that is now most widely known in the English-speaking world was published in French by Charles Perrault in Histoires ou contes du temps passé in 1697.[6] Another version was later published by the Brothers Grimm in their folk tale collection Grimms\' Fairy Tales in 1812.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 9, \"length\": 19, \"offset\": 75}, {\"key\": 10, \"length\": 11, \"offset\": 102}, {\"key\": 11, \"length\": 16, \"offset\": 222}, {\"key\": 12, \"length\": 34, \"offset\": 242}, {\"key\": 13, \"length\": 3, \"offset\": 285}, {\"key\": 14, \"length\": 14, \"offset\": 332}, {\"key\": 15, \"length\": 19, \"offset\": 377}], \"inlineStyleRanges\": [{\"style\": \"ITALIC\", \"length\": 11, \"offset\": 102}, {\"style\": \"ITALIC\", \"length\": 34, \"offset\": 242}, {\"style\": \"ITALIC\", \"length\": 19, \"offset\": 377}]}, {\"key\": \"6gtp1\", \"data\": {}, \"text\": \"Although the story\'s title and main character\'s name change in different languages, in English-language folklore Cinderella is an archetypal name. The word Cinderella has, by analogy, come to mean one whose attributes were unrecognized: one who unexpectedly achieves recognition or success after a period of obscurity and neglect. The still-popular story of Cinderella continues to influence popular culture internationally, lending plot elements,\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {\"0\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-2\", \"href\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-2\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"1\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Folklore\", \"href\": \"https://en.wikipedia.org/wiki/Folklore\", \"title\": \"Folklore\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"2\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-Zipes_2001_444-3\", \"href\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-Zipes_2001_444-3\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"3\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-Dundes,_Alan_1988-4\", \"href\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-Dundes,_Alan_1988-4\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"4\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Rhodopis\", \"href\": \"https://en.wikipedia.org/wiki/Rhodopis\", \"title\": \"Rhodopis\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"5\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Strabo\", \"href\": \"https://en.wikipedia.org/wiki/Strabo\", \"title\": \"Strabo\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"6\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-Zipes_2001_444-3\", \"href\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-Zipes_2001_444-3\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"7\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-Dundes,_Alan_1988-4\", \"href\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-Dundes,_Alan_1988-4\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"8\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-Green_2011,_chapter_\'\'\'The_Land_of_Egypt\'\'\'-5\", \"href\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-Green_2011,_chapter_\'\'\'The_Land_of_Egypt\'\'\'-5\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"9\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Giambattista_Basile\", \"href\": \"https://en.wikipedia.org/wiki/Giambattista_Basile\", \"title\": \"Giambattista Basile\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"10\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Pentamerone\", \"href\": \"https://en.wikipedia.org/wiki/Pentamerone\", \"title\": \"Pentamerone\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"11\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Charles_Perrault\", \"href\": \"https://en.wikipedia.org/wiki/Charles_Perrault\", \"title\": \"Charles Perrault\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"12\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Histoires_ou_contes_du_temps_pass%C3%A9\", \"href\": \"https://en.wikipedia.org/wiki/Histoires_ou_contes_du_temps_pass%C3%A9\", \"title\": \"Histoires ou contes du temps passé\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"13\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-Bottigheimer,_Ruth_2008_pp._175-6\", \"href\": \"https://en.wikipedia.org/wiki/Cinderella#cite_note-Bottigheimer,_Ruth_2008_pp._175-6\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"14\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Brothers_Grimm\", \"href\": \"https://en.wikipedia.org/wiki/Brothers_Grimm\", \"title\": \"Brothers Grimm\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"15\": {\"data\": {\"url\": \"https://en.wikipedia.org/wiki/Grimms%27_Fairy_Tales\", \"href\": \"https://en.wikipedia.org/wiki/Grimms%27_Fairy_Tales\", \"title\": \"Grimms\' Fairy Tales\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}}}',1,0,0,0,0,0,'2022-01-02 12:47:42','2022-01-02 12:47:42',NULL,NULL,NULL,NULL,'2022-01-02 12:47:42','live'),(270,254,'6d9e5e93-6bca-11ec-90e2-9c7bef452e5