 \"offset\": 9}, {\"style\": \"HIGHLIGHT\", \"length\": 11, \"offset\": 35}]}], \"entityMap\": {}}',1,3,0,0,0,0,'2022-01-02 13:58:19','2022-01-18 12:46:47',NULL,NULL,NULL,NULL,'2022-01-02 14:07:06','live'),(285,1,'1a4c1177-6bd5-11ec-90e2-9c7bef452e53','Shahar is queen','ססססססססס\ndelete formToSend.comments;','{\"blocks\": [{\"key\": \"8uq2h\", \"data\": {}, \"text\": \"ססססססססס\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"8k2vm\", \"data\": {}, \"text\": \"delete formToSend.comments;\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {}}',1,0,0,0,0,0,'2022-01-02 14:05:55','2022-01-11 10:57:09',NULL,NULL,NULL,NULL,'2022-01-11 10:57:09','live'),(286,1,'b21cfe0c-72cc-11ec-bd53-9c7bef452e53','My Newest Publication','Custom Entities And Decorators\nThere are also other things called Decorators that use regex to format data at run-time and generate entities. For example: If you enter a “#hastag”, it shows up as a li','{\"blocks\": [{\"key\": \"blpl5\", \"data\": {}, \"text\": \"Custom Entities And Decorators\", \"type\": \"header-one\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"fb92e\", \"data\": {}, \"text\": \"There are also other things called Decorators that use regex to format data at run-time and generate entities. For example: If you enter a “#hastag”, it shows up as a link instantly in the editor itself but may not be exported or may be exported by apps outside of the editor (depends on how it’s implemented).\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"9gi1m\", \"data\": {}, \"text\": \"Export To HTML\", \"type\": \"header-one\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"asacl\", \"data\": {}, \"text\": \"In many cases, you may not want JSON but want a HTML output. At this point there is no official HTML exporter but there are couple open source projects that may work for you:\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"497qm\", \"data\": {}, \"text\": \"https://github.com/sstur/draft-js-export-html\", \"type\": \"ordered-list-item\", \"depth\": 0, \"entityRanges\": [{\"key\": 0, \"length\": 45, \"offset\": 0}], \"inlineStyleRanges\": []}, {\"key\": \"7fvn3\", \"data\": {}, \"text\": \"https://github.com/rkpasia/draft-js-exporter\", \"type\": \"ordered-list-item\", \"depth\": 0, \"entityRanges\": [{\"key\": 1, \"length\": 44, \"offset\": 0}], \"inlineStyleRanges\": []}, {\"key\": \"8ejcn\", \"data\": {}, \"text\": \"That’s it!\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {\"0\": {\"data\": {\"rel\": \"noopener ugc nofollow\", \"url\": \"https://github.com/sstur/draft-js-export-html\", \"href\": \"https://github.com/sstur/draft-js-export-html\", \"target\": \"_blank\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"1\": {\"data\": {\"rel\": \"noopener ugc nofollow\", \"url\": \"https://github.com/rkpasia/draft-js-exporter\", \"href\": \"https://github.com/rkpasia/draft-js-exporter\", \"target\": \"_blank\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}}}',1,0,0,0,0,0,'2022-01-11 10:53:22','2022-01-11 10:53:22',NULL,NULL,NULL,NULL,'2022-01-11 10:53:22','live'),(287,1,'0cb51bfd-72ce-11ec-bd53-9c7bef452e53','Example','React powers the user interfaces (UI) of close to 10 million websites around the world. While the base library of React is solid, there are multiple component libraries filled with valuable design ele','{\"blocks\": [{\"key\": \"jfhn\", \"data\": {}, \"text\": \"React powers the user interfaces (UI) of close to 10 million websites around the world. While the base library of React is solid, there are multiple component libraries filled with valuable design elements for your React app or web development project.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 0, \"length\": 19, \"offset\": 50}], \"inlineStyleRanges\": []}, {\"key\": \"19f3f\", \"data\": {}, \"text\": \"To help you find the best React UI library for your current project, let’s take a look at the most popular React UI libraries on GitHub. We’ll analyze their application in development and bring examples, as well as look at their popularity among developers based on usage statistics from GitHub and npm.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"aapm5\", \"data\": {}, \"text\": \"Let’s start with why you should be thinking about using a React UI library in the first place.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"5vtah\", \"data\": {}, \"text\": \"Do I need a React UI Component Library?\", \"type\": \"header-two\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"4j46t\", \"data\": {}, \"text\": \"Different React UI component libraries each have their pros and cons, which we’ll discuss more in detail below. But in general, using any component library can have many benefits that will help you when working on your React project:\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"emsdd\", \"data\": {}, \"text\": \"Beginner-friendly. UI libraries consist of prebuilt components like buttons, form fields, etc. So, as a beginner, you won’t have to figure out how to create any of the necessary elements from scratch. Instead, you can focus on the implementation and customization with the help of the documentation.\", \"type\": \"unordered-list-item\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 17, \"offset\": 0}]}, {\"key\": \"6j2fv\", \"data\": {}, \"text\": \"Faster prototyping. With ready-made React components at your disposal, you can quickly create several functioning prototypes. This means you can prove that the design concept is functioning without having to spend too much time on any of the details.\", \"type\": \"unordered-list-item\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 18, \"offset\": 0}]}, {\"key\": \"bpb4q\", \"data\": {}, \"text\": \"Saves time. Using a component library saves time not only when prototyping, but also when already working on your React project. It enables you to write less code, as you won’t have to write all the styles yourself.\", \"type\": \"unordered-list-item\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 10, \"offset\": 0}]}, {\"key\": \"bhheu\", \"data\": {}, \"text\": \"Recognizable components by users. Innovation to a certain extent helps your project stand out. But too much innovation in designing UX/UI can put users off. As the UI elements in libraries are designed to be universal, they won’t cause any friction for your users.\", \"type\": \"unordered-list-item\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 32, \"offset\": 0}]}, {\"key\": \"7ar2a\", \"data\": {}, \"text\": \"Customizable components. Despite being universal, most elements can be customized at least to some extent. Each library gives you a different amount of control over the customization, but you’ll be able to make sure your website doesn’t look to much like many others.\", \"type\": \"unordered-list-item\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 23, \"offset\": 0}]}, {\"key\": \"fut8q\", \"data\": {}, \"text\": \"Proven compatibility across devices. Most prebuilt UI components are mobile-responsive by default, which means you won’t have to put a lot of extra effort into ensuring your React project works on different types of devices.\", \"type\": \"unordered-list-item\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 35, \"offset\": 0}]}, {\"key\": \"vajv\", \"data\": {}, \"text\": \"Accessible by default. Most popular React UI component libraries have built-in accessibility features or even fully adhere to WCAG or other standards and best practices. Thanks to this, you won’t have to worry about self-coding semantic tags or keyboard navigation.\", \"type\": \"unordered-list-item\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 21, \"offset\": 0}]}, {\"key\": \"c6vmg\", \"data\": {}, \"text\": \"Crowd-sourced. UI component libraries often have their communities centered around GitHub. This means users can raise issues, request features, and also easily become contributors to the libraries.\", \"type\": \"unordered-list-item\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 13, \"offset\": 0}]}, {\"key\": \"6u7np\", \"data\": {}, \"text\": \"Despite these many upsides, even the best React UI component libraries have some downsides that you should consider before you commit to one:\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"543sv\", \"data\": {}, \"text\": \"Customizing components can be difficult. Depending on the specific library you choose, the ease of customizing components differs. With some React libraries, you get primitive components that are meant to be heavily customized by the developer, but with others, getting the result you want can be tricky.\", \"type\": \"unordered-list-item\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 39, \"offset\": 0}]}, {\"key\": \"7p48i\", \"data\": {}, \"text\": \"Similar web design with other sites. Each React UI library has its design system, so if you choose to use a popular library but don’t customize the components or theme enough, your site can end up looking very similar to other sites using the same library — in some cases, even unoriginal. However, depending on your project, that might not be an issue at all.\", \"type\": \"unordered-list-item\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 35, \"offset\": 0}]}, {\"key\": \"csvpp\", \"data\": {}, \"text\": \"Support relies on the community. Most React UI libraries don’t offer official support but instead guide their users to Stack Overflow, GitHub, Discord, or other similar channels. With less popular libraries, the community is smaller, and getting help can be more complicated.\", \"type\": \"unordered-list-item\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 31, \"offset\": 0}]}, {\"key\": \"48qut\", \"data\": {}, \"text\": \"So, with these important considerations out of the way, let’s take a look at the most popular libraries based on GitHub statistics. We’ve listed the libraries based on their number of active projects on GitHub, starting with the most popular.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"3rhgr\", \"data\": {}, \"text\": \"By the end of this post, you’ll hopefully have found the best React-based UI components library for your web or mobile app development project.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {\"0\": {\"data\": {\"url\": \"https://trends.builtwith.com/javascript/React\", \"href\": \"https://trends.builtwith.com/javascript/React\", \"target\": \"_blank\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}}}',0,0,0,0,0,0,'2022-01-11 11:03:04','2022-01-18 11:26:17',NULL,NULL,NULL,NULL,'2022-01-11 11:03:04','live'),(288,1,'5f44efcf-76cf-11ec-8479-9c7bef452e53','ortal checking file type','okey','{\"blocks\": [{\"key\": \"54ol3\", \"data\": {}, \"text\": \"okey\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {}}',1,0,0,0,0,0,'2022-01-16 13:22:37','2022-01-16 13:22:37',NULL,NULL,NULL,NULL,'2022-01-16 13:22:37','live'),(289,1,'28d2b0c4-76d0-11ec-8479-9c7bef452e53','NEW TEST','NEW TEST',NULL,1,0,0,0,0,0,'2022-01-16 13:28:15','2022-01-16 13:28:15','','','MY REact pdf','React — 5 Things That Might Surprise You_1642339689636.pdf','2022-01-16 13:28:15','dead'),(290,1,'85694b45-76d3-11ec-8479-9c7bef452e53','Can you send unallowed file types?','Sure you can.',NULL,1,1,0,0,0,0,'2022-01-16 13:52:19','2022-01-19 13:55:31','','','New PDF','React — 5 Things That Might Surprise You_1642340787444.pdf','2022-01-16 13:52:19','dead'),(291,1,'72a14204-76d4-11ec-8479-9c7bef452e53','PDF or not PDF?','That is the question.',NULL,0,0,0,0,0,0,'2022-01-16 13:58:56','2022-01-18 11:25:57','','','A pdf','React — 5 Things That Might Surprise You_1642341494887.pdf','2022-01-16 13:58:56','dead'),(292,1,'bbc2a5e9-76d4-11ec-8479-9c7bef452e53','Not a PDF','Is it?',NULL,1,2,0,0,0,0,'2022-01-16 14:00:59','2022-01-18 14:52:18','','','nope','React — 5 Things That Might Surprise You_1642341646422.pdf','2022-01-16 14:00:59','dead'),(293,1,'31090ed1-784f-11ec-8479-9c7bef452e53','debounce search','Since this article focuses on the front-end side, we’ll just use a public API(instead of creating our own) which returns a list of beers given the beer name as a query parameter.\nAPI Endpoint — https:','{\"blocks\": [{\"key\": \"dvcti\", \"data\": {}, \"text\": \"Since this article focuses on the front-end side, we’ll just use a public API(instead of creating our own) which returns a list of beers given the beer name as a query parameter.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"UNDERLINE\", \"length\": 178, \"offset\": 0}, {\"style\": \"HIGHLIGHT\", \"length\": 178, \"offset\": 0}]}, {\"key\": \"36i9e\", \"data\": {}, \"text\": \"API Endpoint — https://api.punkapi.com/v2/beers\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 0, \"length\": 32, \"offset\": 15}], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 12, \"offset\": 0}]}, {\"key\": \"eujro\", \"data\": {}, \"text\": \"Query Parameter — beer_name(String)\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 15, \"offset\": 0}]}, {\"key\": \"e17di\", \"data\": {}, \"text\": \"API Documentation — https://punkapi.com/documentation/v2\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 1, \"length\": 36, \"offset\": 20}], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 17, \"offset\": 0}]}, {\"key\": \"3dnl8\", \"data\": {}, \"text\": \"First, let’s create a file utils.js that exports the function to fetch response from the API.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"dius2\", \"data\": {}, \"text\": \"utils.js\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 8, \"offset\": 0}]}, {\"key\": \"1kpkp\", \"data\": {}, \"text\": \"export const BASE_URL = \'https://api.punkapi.com/v2\';/* This function takes query as a param and returns the array of beer objects.*/export const fetchSearchResults = async query => {if (query && query.length > 0) {/* replaces all whitespaces in the query with + symbol in order to \\nsend it as a query param in the GET request */\\nconst parsedQuery = query.replaceAll(\' \', \'+\');const url = `${BASE_URL}/beers?beer_name=${parsedQuery}`;const res = await fetch(url);.search-container {\\ndisplay: flex;\\njustify-content: center;\\nmargin-bottom: 24px;\\n}.search-container input {height: 32px;\\nwidth: 300px;\\npadding: 0px 12px 0px 12px;\\n}const resJson = res.json();return resJson;} else {return [];}};\", \"type\": \"code-block\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 690, \"offset\": 0}, {\"style\": \"ITALIC\", \"length\": 625, \"offset\": 0}]}, {\"key\": \"78da1\", \"data\": {}, \"text\": \"Now, we’ll need our list item, so let’s create a component ListItem.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 8, \"offset\": 59}]}, {\"key\": \"3rg4k\", \"data\": {}, \"text\": \"ListItem.js\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 11, \"offset\": 0}]}, {\"key\": \"1urc\", \"data\": {}, \"text\": \"import React from \'react\';\\nimport \'./ListItem.css\';const ListItem = ({ title, caption, imageUrl }) => {return (<div class=\\\"list-item-container\\\">\\n <div className=\\\"left\\\">\\n  <img src={imageUrl} className=\\\"thumbnail\\\" />\\n </div>\\n <div className=\\\"center\\\">\\n  <h4>{title}</h4>\\n  <p>{caption}</p>\\n </div>\\n <div className=\\\"right\\\">\\n  <p>&#8250;</p>\\n </div>\\n</div>);\\n};export default ListItem;\", \"type\": \"code-block\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 381, \"offset\": 0}]}, {\"key\": \"e5n87\", \"data\": {}, \"text\": \"ListItem.css kl ll l oo ll\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 26, \"offset\": 0}]}, {\"key\": \"ml47\", \"data\": {}, \"text\": \".list-item-container {\\n display: flex;\\n padding: 8px;\\n border-bottom: 1px solid #e6e6e6;\\n}.center {\\n flex: 4;\\n}.left {\\n flex: 1;\", \"type\": \"code-block\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"CODE\", \"length\": 128, \"offset\": 0}]}], \"entityMap\": {\"0\": {\"data\": {\"rel\": \"noopener ugc nofollow\", \"url\": \"https://api.punkapi.com/v2/beers\", \"href\": \"https://api.punkapi.com/v2/beers\", \"target\": \"_blank\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"1\": {\"data\": {\"rel\": \"noopener ugc nofollow\", \"url\": \"https://punkapi.com/documentation/v2\", \"href\": \"https://punkapi.com/documentation/v2\", \"target\": \"_blank\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}}}',1,2,0,0,0,0,'2022-01-18 11:10:06','2022-01-18 16:02:49',NULL,NULL,NULL,NULL,'2022-01-18 11:30:20','live'),(294,1,'df101893-7850-11ec-8479-9c7bef452e53','dsjb','xhofdhrgu  shalom olam',NULL,1,1,0,0,0,0,'2022-01-18 11:22:07','2022-01-18 15:39:00','lonju','https://www.youtube.com/watch?v=7YcW25PHnAA','jsakskh','Payment-Agreement-Template-Signaturely_1642504922182.pdf','2022-01-18 11:29:35','dead'),(295,1,'f882b6c2-7850-11ec-8479-9c7bef452e53','hskhdl gb','sxldslhv bdbdd add',NULL,1,3,0,0,0,0,'2022-01-18 11:22:50','2022-01-19 12:49:14','','','fd','Payment-Agreement-Template-Signaturely_1642504953262.pdf','2022-01-18 11:29:58','dead'),(296,1,'32c6aaec-7854-11ec-8479-9c7bef452e53','Business Benefits of Using React For Frontend Deve','The front-end environment is always developing. There is a continuous process of publishing new features, and company owners are struggling to select the framework for their development team. In contr','{\"blocks\": [{\"key\": \"390b4\", \"data\": {}, \"text\": \"The front-end environment is always developing. There is a continuous process of publishing new features, and company owners are struggling to select the framework for their development team. In contrast to other development frameworks, React JS is proven to be the top used one for web development.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": [{\"style\": \"BOLD\", \"length\": 299, \"offset\": 0}]}, {\"key\": \"6ckgj\", \"data\": {}, \"text\": \"What is ReactJS?\", \"type\": \"header-two\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"fmvlq\", \"data\": {}, \"text\": \"React JS is a free access library that was created by Meta. This library allows you to create quick and adjustable frontend solutions for web pages. The language called JSX is the syntax of ReactJs.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"656mt\", \"data\": {}, \"text\": \"Being based on JavaScript, it processes HTML quoting and builds subcomponents with help of the structure of this HTML element. So many people use ReactJS because it can help you segment complicated interfaces, giving you a chance to focus on specific elements.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 0, \"length\": 22, \"offset\": 30}], \"inlineStyleRanges\": []}, {\"key\": \"3im70\", \"data\": {}, \"text\": \"Business benefits of using React for frontend development\", \"type\": \"header-two\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"5s980\", \"data\": {}, \"text\": \"If you plan to create a user-friendly and practical webpage, then ReactJS is the first technology you should consider. The creation of a user interface requires not only UI components but ReactJS too.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 1, \"length\": 13, \"offset\": 170}], \"inlineStyleRanges\": []}, {\"key\": \"7pjrs\", \"data\": {}, \"text\": \"However, with new tools being introduced on a daily basis and organizations seeking to get more work done in less time, deciding on the best programming tool or library is getting increasingly challenging. In this article, we’ll go through nine reasons for ReactJS.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"47cl8\", \"data\": {}, \"text\": \"Reduced web application development costs due to reusable React components\", \"type\": \"header-three\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"47mr2\", \"data\": {}, \"text\": \"ReactJS’s modular nature makes it simple to make minor adjustments. As a consequence, developers may reuse the same objects without disrupting other components. Reusable components provide their code for comparable functionality without requiring the author to rewrite them entirely.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"6jin5\", \"data\": {}, \"text\": \"Furthermore, ReactJS allows developers to use specific application components for multiple purposes. These features save time by reducing the frequency with which the current code is debugged.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"62hkj\", \"data\": {}, \"text\": \"React.js makes your business applications SEO-friendly\", \"type\": \"header-three\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"7b0u2\", \"data\": {}, \"text\": \"In contrast to other applications, ReactJS notably lowers page loading speed and delivers quicker rendering speed. A faster processing speed contributes to a lower bounce rate for your websites. In addition, applications and web pages created with ReactJS are faster to scroll.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 2, \"length\": 35, \"offset\": 158}], \"inlineStyleRanges\": []}, {\"key\": \"cb3dp\", \"data\": {}, \"text\": \"This enhancement is achieved through the usage of server-side rendering, which allows you to execute the JavaScript code before making the files visible to the user. Furthermore, server-side rendering speeds up page loading since Google does not need to execute JavaScript to scan the site.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"6vsct\", \"data\": {}, \"text\": \"Problems are solved quickly because of strong React community support\", \"type\": \"header-three\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"cr7ig\", \"data\": {}, \"text\": \"Because it is open-source, many developers choose ReactJS as their main development tool. The great community support that React developers receive from every corner of the planet via forums and online communities benefits everyone.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"bu36\", \"data\": {}, \"text\": \"Experts are also constantly providing free tutorials on React on video platforms and authoring detailed articles about React in blogs. A significant number of costless ReactJS courses tells that anyone can benefit from ReactJS community spirit.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"585id\", \"data\": {}, \"text\": \"One-way data flow leads to stable code\", \"type\": \"header-three\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"emka7\", \"data\": {}, \"text\": \"By employing one-way data flow, ReactJS makes sure that adjustments to the minor elements have no impact on major elements. In this way, typing some words into a text box will not modify the format of an element. Instead, it makes adjustments to the structure of data.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"638n\", \"data\": {}, \"text\": \"Applying this model to your company’s website will make the code more reliable. Such independence in component manipulation allows for simple troubleshooting because software engineers can use attributes to eject values from the parent component and employ them in the child component.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 3, \"length\": 22, \"offset\": 23}], \"inlineStyleRanges\": []}, {\"key\": \"ba368\", \"data\": {}, \"text\": \"Going mobile is easy with React Native\", \"type\": \"header-three\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"fs9e8\", \"data\": {}, \"text\": \"Because ReactJS code can be combined with React Native, it allows for seamless transfer from the web to mobile. Developers who use this app can work quicker with JS code since they don’t have to reload their app after each modification to see results.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"3hr4r\", \"data\": {}, \"text\": \"It is enough to update the viewing screen to see the changes. Moreover, software engineers have the option of designing the application using React’s elements.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"1kd5e\", \"data\": {}, \"text\": \"Accelerated development process due to the simple component scripting\", \"type\": \"header-three\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"50pus\", \"data\": {}, \"text\": \"React is enhanced with an ability to reuse web elements. Thanks to this feature, one can reinstall sample digital components. In other words, you can design some sample elements, assign them to a separate group, and then reuse them as many times as needed.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"5bpe6\", \"data\": {}, \"text\": \"This technique essentially allows for high-quality code management as well as scalability since each element in React has a unique underlying logic. When element management is made easier, developers have no problems with understanding how to manipulate it and, as a consequence, the development efficiency grows.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"11ooa\", \"data\": {}, \"text\": \"Improved application performance as well as a better user experience due to the virtual DOM\", \"type\": \"header-three\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"7sa18\", \"data\": {}, \"text\": \"In ReactJS, all components from the real DOM are duplicated in the virtual DOM. The virtual DOM enables developers to change the elements of the webpage without affecting the structure of the code.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"2o717\", \"data\": {}, \"text\": \"A real DOM would take much longer to perform the same task. Virtual DOM works faster because it takes all recent adjustments and then calculates the fastest method to transfer these updates to the original DOM.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 4, \"length\": 24, \"offset\": 60}], \"inlineStyleRanges\": []}, {\"key\": \"25h33\", \"data\": {}, \"text\": \"When the code is long and complex, it is much more efficient to focus on several elements that were changed rather than updating all of them. As a result, online users can enjoy their experience with your apps and web pages.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"1plmq\", \"data\": {}, \"text\": \"React is used by many Fortune 500 companies\", \"type\": \"header-three\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"35mnm\", \"data\": {}, \"text\": \"A tendency among Fortune 500 businesses to utilize ReactJS is increasing. In the list of the companies are Airbnb, Tesla, Tencent QQ, and Walmart. They have created custom mobile apps using React Native platform.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"94n71\", \"data\": {}, \"text\": \"In addition, React JS has been chosen by the world’s most known organizations like Paypal, NASA, BBC, Lyft, New York Times, and Netflix. Since such a big number of successful firms use ReactJS and React Native, it can be considered a really effective platform for the development of websites. This means that there is a huge quantity of independent engineers striving to improve React.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"9q7ig\", \"data\": {}, \"text\": \"Conclusion\", \"type\": \"header-two\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}, {\"key\": \"651ug\", \"data\": {}, \"text\": \"It should be made clear that the extent to which React is beneficial does not end with the development phase. Its advantages extend across numerous aspects of your organization, from fighting for SEO achievements to strengthening UX and expanding development operations on various projects. Click here to learn how high-skilled web engineers apply React to create dynamic and elegantly constructed frontend web applications without sacrificing quality. It is an established, yet growing technology that contributes to the long-term viability of any enterprise.\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [{\"key\": 5, \"length\": 10, \"offset\": 291}], \"inlineStyleRanges\": []}], \"entityMap\": {\"0\": {\"data\": {\"url\": \"https://www.w3schools.com/html/html_quotation_elements.asp\", \"href\": \"https://www.w3schools.com/html/html_quotation_elements.asp\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"1\": {\"data\": {\"url\": \"https://www.usability.gov/how-to-and-tools/methods/user-interface-elements.html\", \"href\": \"https://www.usability.gov/how-to-and-tools/methods/user-interface-elements.html\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"2\": {\"data\": {\"url\": \"https://rockcontent.com/blog/reduce-bounce-rate/\", \"href\": \"https://rockcontent.com/blog/reduce-bounce-rate/\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"3\": {\"data\": {\"url\": \"https://www.edmchicago.com/building-business-website/\", \"href\": \"https://www.edmchicago.com/building-business-website/\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"4\": {\"data\": {\"url\": \"https://www.quora.com/Why-is-Reacts-virtual-DOM-so-much-faster-than-the-real-DOM\", \"href\": \"https://www.quora.com/Why-is-Reacts-virtual-DOM-so-much-faster-than-the-real-DOM\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}, \"5\": {\"data\": {\"url\": \"https://ddi-dev.com/technology/hire-react-developers/\", \"href\": \"https://ddi-dev.com/technology/hire-react-developers/\"}, \"type\": \"LINK\", \"mutability\": \"MUTABLE\"}}}',1,204,0,0,0,0,'2022-01-18 11:45:56','2022-01-20 14:54:32',NULL,NULL,NULL,NULL,'2022-01-18 11:46:11','live'),(297,1,'64504cd8-785e-11ec-8479-9c7bef452e53','Stormy Weather','Stormy Weather is a 1943 American musical film produced and released by 20th Century Fox. The film is one of two Hollywood musicals with an African American cast released in 1943, the other being MGM\'s Cabin in the Sky. The film is considered a primary showcase of some of the leading African American performers of the day, during an era when African American actors and singers rarely appeared in lead roles in mainstream Hollywood productions.',NULL,1,11,0,0,0,0,'2022-01-18 12:58:54','2022-01-20 14:54:23','Stormy Weather','https://www.youtube.com/watch?v=Uj73PJ8suPE','scrollLocation','React — 5 Things That Might Surprise You_1642510728798.pdf','2022-01-18 12:58:54','dead'),(298,1,'b3f5b1b8-785f-11ec-8479-9c7bef452e53','Groundhog Day','Groundhog Day is a 1993 American fantasy comedy film directed by Harold Ramis and written by Ramis and Danny Rubin. It stars Bill Murray, Andie MacDowell and Chris Elliott. Murray portrays Phil Connors, a cynical television weatherman covering the annual Groundhog Day event in Punxsutawney, Pennsylvania, who becomes trapped in a time loop, forcing him to relive February 2nd repeatedly. The film also stars Stephen Tobolowsky, Brian Doyle-Murray, Marita Geraghty, Angela Paton, Rick Ducommun, Rick',NULL,1,5,0,0,0,0,'2022-01-18 13:08:17','2022-01-19 14:43:16','Groundhog Day','https://en.wikipedia.org/wiki/Groundhog_Day_(film)',NULL,NULL,'2022-01-18 13:08:17','dead'),(299,1,'fecf05c5-785f-11ec-8479-9c7bef452e53','The Leftovers','The Leftovers is an American supernatural mystery drama television series created by Damon Lindelof and Tom Perrotta, that aired on HBO from June 29, 2014, to June 4, 2017.[1] Based on Perrotta\'s 2011 novel of the same name,[2] the series begins three years after the \"Sudden Departure\", a global event that resulted in 2% of the world\'s population disappearing. The lives of police chief Kevin Garvey (Justin Theroux) and his family, along with grieving widow Nora Durst (Carrie Coon) and her brothe',NULL,1,4,0,0,0,0,'2022-01-18 13:10:23','2022-01-20 14:01:12','The Leftovers','',NULL,NULL,'2022-01-17 22:00:00','dead'),(300,1,'2eb7972d-7860-11ec-8479-9c7bef452e53','The Leftovers5','The Leftovers is an American supernatural mystery drama television series created by Damon Lindelof and Tom Perrotta, that aired on HBO from June 29, 2014, to June 4, 2017.[1] Based on Perrotta\'s 2011 novel of the same name,[2] the series begins three years after the \"Sudden Departure\", a global event that resulted in 2% of the world\'s population disappearing. The lives of police chief Kevin Garvey (Justin Theroux) and his family, along with grieving widow Nora Durst (Carrie Coon) and her brothe',NULL,1,21,0,0,0,0,'2022-01-18 13:11:43','2022-01-20 12:46:28',NULL,NULL,'The Leftovers2','What Is Cryptocurrency_ Beginners Guide to Digital Cash - NerdWallet_1642511500117.pdf','2022-01-20 11:24:03','dead'),(301,1,'4cbd2980-7902-11ec-8479-9c7bef452e53','My New Draft','','{\"blocks\": [{\"key\": \"adacm\", \"data\": {}, \"text\": \"\", \"type\": \"unstyled\", \"depth\": 0, \"entityRanges\": [], \"inlineStyleRanges\": []}], \"entityMap\": {}}',0,0,0,0,0,0,'2022-01-19 08:32:12','2022-01-20 11:50:36',NULL,NULL,NULL,NULL,'2022-01-20 11:49:02','live'),(302,1,'f920b35b-7904-11ec-8479-9c7bef452e53','Drafty','Drafty',NULL,1,0,0,0,0,0,'2022-01-19 08:51:20','2022-01-19 08:51:20',NULL,NULL,NULL,NULL,'2022-01-18 22:00:00','dead'),(303,1,'e82a5deb-7905-11ec-8479-9c7bef452e53','Not Working ?????','Not Working',NULL,0,0,0,0,0,0,'2022-01-19 08:58:01','2022-01-20 11:25:33',NULL,NULL,'My beloved pdf','React — 5 Things That Might Surprise You_1642677766955.pdf','2022-01-20 11:24:12','dead'),